import React, { useState } from "react";
import { useSelector, useDispatch } from "react-redux";
import { updateUser } from "../profile/profile-reducer";
import { Link } from "react-router-dom";

const EditProfile = () => {

    const { user } = useSelector((state) => state.user);
    const [profile, setProfile] = useState(user);
    const dispatch = useDispatch();
    const handleSaveButton = () => {
        dispatch(updateUser(profile));
    }

    return (
        <>
            <div className="row mt-1">
                <div className="col-1">
                    <Link to="../profile" >
                        <i className="bi bi-x fs-3 mt-1 text-black"> </i>
                    </Link>
                </div>

                <h4 className="col-9 mt-2 ms-2">Edit Profile</h4>
                <button
                    onClick={handleSaveButton}
                    className="col btn btn-dark rounded-5 float-end me-4">Save</button>
            </div>

            <div className="mb-5">
                <img className="img-fluid mt-2"
                    src={`/images/${profile.bannerPicture}`} alt='Banner Image' /><br />
                <img width={120} className="rounded-circle ms-3 wd-profile-avatar-style"
                    src={`/images/${profile.profilePicture}`} alt='Profile Image' />
            </div>

            <div className="input-group ms-3 me-3 mb-5">

                {/* <label for="username">Username:</label>
                <input type="text" id="username" name="username" title="Enter your username here" ></input> */}

                {/* <div className="form-group">
                    <label for="username">Username:</label>
                    <input className="pt-5 pb-5" type="text" class="form-control" id="username" name="username" title="Enter your username here"></input>
                </div> */}

                <div className="input-group-addon wd-input-style">
                    <label className="wd-input-title-style text-secondary">First Name</label>
                    <input type="text" size={70} className="wd-input-box-style " />
                </div>




                <div className="input-group-addon">
                    <label className="text-secondary">First Name</label><br />
                    <input
                        size={70}
                        placeholder="FirstName"
                        title="Enter your first name here"
                        value={profile.firstName}
                        onChange={(e) => setProfile({
                            ...profile,
                            firstName: e.target.value,
                        })} /><br /><br />
                </div>

                <div className="input-group-addon">
                    <label className="text-secondary">Last Name</label><br />
                    <input
                        size={70}
                        placeholder="LastName"
                        title="Enter your last name here"
                        value={profile.lastName}
                        onChange={(e) => setProfile({
                            ...profile,
                            lastName: e.target.value,
                        })} /><br /><br />
                </div>

                <div className="input-group-addon">
                    <label className="text-secondary">Bio</label><br />
                    <textarea name="Text1" cols="69" rows="5" value={profile.bio} onChange={(e) => setProfile({
                        ...profile,
                        bio: e.target.value,
                    })}></textarea><br /><br />
                </div>

                <div className="input-group-addon">
                    <label className="text-secondary">Location</label><br />
                    <input
                        size={70}
                        placeholder="City, State/Province"
                        value={profile.location}
                        onChange={(e) => setProfile({
                            ...profile,
                            location: e.target.value,
                        })} /><br /><br />
                </div>

                <div className="input-group-addon">
                    <label className="text-secondary">Website</label><br />
                    <input
                        size={70}
                        placeholder="https://yourURL"
                        value={profile.website}
                        onChange={(e) => setProfile({
                            ...profile,
                            website: e.target.value,
                        })} /><br /><br />
                </div>

